import ContactForm from './ContactForm';
import '../App.css'

function App() {
  return (
    <div className="App">

      <div style={{background:'white', margin}}>

      <h1>Apply for a Job</h1> 

      <div> 
        <ContactForm/>
      </div>

      </div>

    </div>
  );
}

export default App;
